import {ListGroup} from "reactstrap";
import {Link} from "react-router-dom";

import CartItem from "./CartItem";

import closeImg from "../../../assets/images/close-circle-fill.svg"

import "../../../styles/shopping-cart.css"

const Carts = () => {
    return (
        <div className="cart_container">
            <ListGroup className="cart border = p-1">
                <div className="cart_close">
                    <span> <i className="ri-close-circle-fill"> <img src={closeImg} alt="close" style={{width: "25px", height: "30px"}}/></i></span>
                </div>
                <div className="cart_item_list">
                    <CartItem/>
                </div>
                <div className="cart_bottom">
                    <h6>Сумма: <span> 123.000</span></h6>
                    <button><Link to="/checkout">Оплатить</Link></button>
                </div>
            </ListGroup>
        </div>
    );
}

export default Carts;
